import './App.css';
import LoginPage from './components/login/login';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './components/home/home';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/login">
            <LoginPage />
          </Route>
        </Routes>
        <Routes>
          <Route path="/home">
            <HomePage />
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
